import FormStd from './FormStd';
import TableStd from './TableStd';
import { Route, Link, BrowserRouter as Router } from 'react-router-dom'  


function App() {
  return (
    <div className="App">

      <Routes>
        <Route path='/' Component={'./TableStd'} ></Route>
        <Route path='/FormStd' Component={'./FormStd'} ></Route>
      </Routes>


    </div>
  );
}

export default App;
